import userEvent from '@testing-library/user-event'
import Cards from './Cards'
import './list.css'


const List = (props) => {
    return(
        <div className="cardList">
            {props.users.map((user) => (
            <Cards key={user.id.value} 
            users={user}
            first={user.name.first}
            last={user.name.last}

            />
            ))}
        </div>
    );
};




export default List;
